import React from 'react';
import ReactDOM from 'react-dom';
import { AuthProvider } from ''; // Импортируем AuthProvider
import { QueryClient, QueryClientProvider } from 'react-query'; // Импортируем QueryClient и QueryClientProvider
import { UserProvider } from './pages/Auto/Hooks/UserContext'; // Импортируем UserProvider
import App from './App'; // Импортируем компонент App

const root = document.getElementById('root');
const queryClient = new QueryClient();

const createRoot = ReactDOM.createRoot(root);
createRoot.render(
  <React.StrictMode>
    <QueryClientProvider client={queryClient}>
      <UserProvider>
        <AuthProvider>
          <App />
        </AuthProvider>
      </UserProvider>
    </QueryClientProvider>
  </React.StrictMode>
);
